// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "../node_modules/@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./ERC1155Token.sol";

struct LootBox {
  uint256 index;
  uint256 fromId;
  uint256 toId;
  uint256 count;
  uint256 supply;
  address seller;
  address creator;
  uint256 creatorRoyalty;
  uint256 price;
  uint256[] lootBoxItemsIndex;
  uint256 release;
  uint256 dropRate;
}

struct LootBoxItem {
  uint256 index;
  uint256 lootBoxIndex;
  uint256 fromId;
  uint256 toId;
  uint256 count;
  uint256 supply;
  address artist;
  uint256 artistRoyalty;
}

contract Topx is Initializable, ERC1155Token {

  uint256 private randomNounce;
  uint256 private platformRoyalty;
  address private treasury;

  mapping(uint256 => LootBox) public lootBoxes;
  mapping(uint256 => LootBoxItem) public lootBoxItems;
  mapping(uint256 => uint256) public tokenIdToLootBoxIndex;
  mapping(uint256 => uint256) public tokenIdToLootBoxItemsIndex;
  mapping(uint256 => uint8) public tokenIdType;

  function initialize(string memory _uri, address _minter, uint256 _platformRoyalty, address _treasury) public initializer {
    __ERC1155Token_init(_uri, _minter);
    platformRoyalty = _platformRoyalty;
    treasury = _treasury;
  }

  event EthTopxTransfer(uint8 _action, uint256 _tokenId, uint256 _amount, address _from, address _to);

  event addLootBox(uint256 _packid, uint256 _from, address _creator, uint256 _price, uint256 _supply);
  event addLootBoxItem(uint256 _itemid, uint256 _packid, uint256 _from, address _artist, uint256 _supply);

  function addLootBoxes(LootBox memory _lootBox, LootBoxItem[] memory _lootBoxItems) public {
    require(hasRole(MINTER_ROLE, _msgSender()), "Not a minter");
    LootBox memory lootBox = _lootBox;
    uint256 lootBoxItemsCount = _lootBoxItems.length;
    emit addLootBox(lootBox.index, lootBox.fromId, lootBox.creator, lootBox.price, lootBox.supply);
    for (uint256 i=0; i<lootBoxItemsCount; i++) {
      LootBoxItem memory lootBoxItem = _lootBoxItems[i];
      lootBoxItems[lootBoxItem.index] = lootBoxItem;
      emit addLootBoxItem(lootBoxItem.index, lootBox.index, lootBoxItem.fromId, lootBoxItem.artist, lootBoxItem.supply);
    }
    lootBoxes[lootBox.index] = lootBox;
  }

  event mintLootBox(uint256 _id, address _account, uint256 _tokenId, uint256 _count);

  function buyLootBox(uint256 lootBoxIndex) public payable returns (uint256) {
    require(lootBoxes[lootBoxIndex].index > 0, "Exists");
    require(msg.value >= lootBoxes[lootBoxIndex].price, "Price");
    require(block.timestamp >= lootBoxes[lootBoxIndex].release, "Release");
    require(lootBoxes[lootBoxIndex].count <= lootBoxes[lootBoxIndex].supply, "Supply");
    uint256 toCreatorRoyalty = mulDiv(msg.value, lootBoxes[lootBoxIndex].creatorRoyalty);
    payable(lootBoxes[lootBoxIndex].creator).transfer(toCreatorRoyalty);
    payable(lootBoxes[lootBoxIndex].seller).transfer(msg.value - toCreatorRoyalty);
    uint256 tokenId = lootBoxes[lootBoxIndex].fromId + lootBoxes[lootBoxIndex].count;
    tokenIdToLootBoxIndex[tokenId] = lootBoxIndex;
    tokenIdType[tokenId] = 1;
    lootBoxes[lootBoxIndex].count += 1;
    emit mintLootBox(lootBoxIndex, msg.sender, tokenId, lootBoxes[lootBoxIndex].count);
    _mint(msg.sender, tokenId, 1, "");
    emit EthTopxTransfer(0, tokenId, msg.value - toCreatorRoyalty, msg.sender, lootBoxes[lootBoxIndex].seller);
    emit EthTopxTransfer(1, tokenId, toCreatorRoyalty, msg.sender, lootBoxes[lootBoxIndex].creator);
    return tokenId;
  }

  event mintItem(uint256 _id, address _account, uint256 _tokenId);

  function openLootBox(uint256 tokenId) public {
    require(lootBoxes[tokenIdToLootBoxIndex[tokenId]].index > 0, "Exists");
    require(tokenIdType[tokenId] == 1, "Is box");
    _burn(msg.sender, tokenId, 1);
    uint256 lootBoxIndex = tokenIdToLootBoxIndex[tokenId];
    for (uint256 i=0; i<lootBoxes[lootBoxIndex].dropRate; i++) {
      uint256 availables = (lootBoxes[lootBoxIndex].supply - lootBoxes[lootBoxIndex].count + 1) * lootBoxes[lootBoxIndex].dropRate;
      uint256 rand = random(availables - i);
      uint256 counter = 0;
      for (uint256 j=0; j<lootBoxes[lootBoxIndex].lootBoxItemsIndex.length; j++) {
        uint256 currentItem = lootBoxes[lootBoxIndex].lootBoxItemsIndex[j];
        counter = counter + (lootBoxItems[currentItem].supply - lootBoxItems[currentItem].count);
        if (rand <= counter) {
          uint256 mintedTokenId = lootBoxItems[currentItem].fromId + lootBoxItems[currentItem].count;
          lootBoxItems[currentItem].count++;
          emit mintItem(currentItem, msg.sender, mintedTokenId);
          _mint(msg.sender, mintedTokenId, 1, "");
          tokenIdType[mintedTokenId] = 2;
          tokenIdToLootBoxItemsIndex[mintedTokenId] = currentItem;
          break;
        }
      }
    }
  }

  function buyAndOpenLootBox(uint256 lootBoxIndex) public payable{
    uint256 tokenId = buyLootBox(lootBoxIndex);
    openLootBox(tokenId);
  }

  function getCreatorRoyaltyFromAmountForTokenId(uint256 tokenId, uint256 amount) public view returns (uint256) {
    if (tokenIdType[tokenId] == 1) {
      return mulDiv(amount, lootBoxes[tokenIdToLootBoxIndex[tokenId]].creatorRoyalty);
    }
    if (tokenIdType[tokenId] == 2) {
      return mulDiv(amount, lootBoxes[lootBoxItems[tokenIdToLootBoxItemsIndex[tokenId]].lootBoxIndex].creatorRoyalty);
    }
    return 0;
  }

  function getCreatorAddressForTokenId(uint256 tokenId) public view returns (address) {
    if (tokenIdType[tokenId] == 1) {
      return lootBoxes[tokenIdToLootBoxIndex[tokenId]].creator;
    }
    if (tokenIdType[tokenId] == 2) {
      return lootBoxes[lootBoxItems[tokenIdToLootBoxItemsIndex[tokenId]].lootBoxIndex].creator;
    }
    return address(this);
  }

  function getArtistRoyaltyFromAmountForTokenId(uint256 tokenId, uint256 amount) public view returns (uint256) {
    if (tokenIdType[tokenId] == 1) {
      return 0;
    }
    return mulDiv(amount, lootBoxItems[tokenIdToLootBoxItemsIndex[tokenId]].artistRoyalty);
  }

  function getArtistForTokenId(uint256 tokenId) public view returns (address) {
    if (tokenIdType[tokenId] == 1) {
      return address(this);
    }
    return lootBoxItems[tokenIdToLootBoxItemsIndex[tokenId]].artist;
  }

  function getPlatformRoyalty(uint256 amount) public view returns (uint256) {
    return mulDiv(amount, platformRoyalty);
  }

  function mulDiv(uint256 x, uint256 y) public pure returns (uint256) {
    uint256 z = 10000;
    uint256 a = x / z;
    uint256 b = x % z;
    uint256 c = y / z;
    uint256 d = y % z;
    return a * b * z + a * d + b * c + b * d / z;
  }

  function random(uint256 size) private returns (uint256) {
    randomNounce++;
    return uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, randomNounce))) % size;
  }

  function updatePlatformRoyalty(uint256 _platformRoyalty) private {
    require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Not an admin");
    platformRoyalty = _platformRoyalty;
  }

  function getTreasury() public view returns (address) {
    return treasury;
  }
}
